import java.util.HashMap;
import java.util.Map;

public class Leet389Findthedifference {
    public char findTheDifference(String s, String t) {
        Map<Character, Integer> map = new HashMap<>();

        for (int i = 0; i<s.toCharArray().length; i++){
            if (map.containsKey(s.charAt(i))){
                map.put(s.charAt(i), map.get(s.charAt(i))+1);
            }
            else {
                map.put(s.charAt(i), 1);
            }
        }


        for (char c:t.toCharArray()){
            // System.err.println("Loop: " + c);
            if(map.containsKey(c)){
                // System.err.println("Loop Contains: "+ c);
                // map.remove(c);
                map.put(c, map.get(c)-1);
                if (map.get(c) < 0){
                    return c;
                }
                continue;
            }
            else{
                return c;
            } 

        }

        for (Map.Entry<Character, Integer> e : map.entrySet()) {
            System.err.println("Key: " + e.getKey() + " Value: " + e.getValue());
        }

        return 'h';
    }

    public static void main(String[] args) {
        Leet389Findthedifference leet = new Leet389Findthedifference();
        System.out.println(leet.findTheDifference(
                "",
                ""));
    }
}
